INSERT INTO `guides` VALUES (9494,26362,'Question','<p>Please provide the full title of the plan.&nbsp; Example: \"Data Management Plan for *** Project\", where *** is the name of the project.</p>','2013-02-16 12:15:07','2013-05-20 14:40:26'),(9495,26366,'Question','<p>To describe its research activities, the University of Oxford will normally publish DMPs of funded projects, or of projects being undertaken without external funding, unless there is good reason not to do so.&nbsp; DMPs will, of course, be kept confidential while funding applications are under review, and after failed funding attempts</p>','2013-02-16 12:15:52','2013-02-16 12:15:52'),(9496,26367,'Question','<p>will be issued when published &ndash; insert if known</p>','2013-02-16 12:16:41','2013-02-16 12:16:41'),(9497,26400,'Question','<p>separated entries with commas</p>','2013-02-16 12:17:49','2013-02-16 12:17:49'),(9498,26363,'Question','<p>(Integer number, incrementing from 1)</p>','2013-05-20 14:41:03','2013-05-20 14:41:03'),(9499,26364,'Question','<p>(Format dd-mm-yyyy)</p>','2013-05-20 14:42:18','2013-05-20 14:42:18'),(9500,26407,'Question','<p>(if applicable)</p>','2013-05-20 14:45:05','2013-05-20 14:45:05');
